import React from 'react';
import './Projects.css';

const Projects = () => {
  const projects = [
    {
      title: "Project 1",
      description: "Description of project 1. Add your detailed project description here explaining the key features and technologies used.",
    },
    {
      title: "Project 2",
      description: "Description of project 2. Add your detailed project description here explaining the key features and technologies used.",
    },
    {
      title: "Project 3",
      description: "Description of project 3. Add your detailed project description here explaining the key features and technologies used.",
    },
    {
      title: "Project 4",
      description: "Description of project 4. Add your detailed project description here explaining the key features and technologies used.",
    }
  ];

  return (
    <section className="projects" id="projects">
      <h2>My Projects</h2>
      <div className="projects-container">
        {projects.map((project, index) => (
          <div className="project-card" key={index}>
            <div className="project-image">
              {/* Image placeholder - you can add your images later */}
            </div>
            <div className="project-info">
              <h3>{project.title}</h3>
              <p>{project.description}</p>
              <div className="project-links">
                <a href="#" className="btn">View Project</a>
                <a href="#" className="btn">Source Code</a>
              </div>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Projects;
